@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

atm:Bank a owl:Class .
atm:Computer a owl:Class .
atm:Software a owl:Class .
atm:Security a owl:Class .

atm:providesSecurity a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Security .

atm:hasComputer a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Computer .

atm:hasSoftware a owl:ObjectProperty ;
  rdfs:domain atm:Bank ;
  rdfs:range atm:Software .

atm:SecurityForComputer a owl:Class ;
  rdfs:subClassOf atm:Security ;
  rdfs:subClassOf [ a owl:Restriction ;
                     owl:onProperty atm:hasComputer ;
                     owl:someValuesFrom atm:Computer
                   ] .

atm:SecurityForSoftware a owl:Class ;
  rdfs:subClassOf atm:Security ;
  rdfs:subClassOf [ a owl:Restriction ;
                     owl:onProperty atm:hasSoftware ;
                     owl:someValuesFrom atm:Software
                   ] .
